import React from "react";
import './comp.css';
function Navbar()
{
    return(
        <header className="Nav">
            <img src="./fox.ico" alt="Fox image"/>
            <a href='Home'>Home</a>
            <a href='Contact'>Contact</a>
        </header>
    )
}
export default Navbar
